export function convertTime(time: String)
{
    const actualTime = time.split(":");
    const hour = actualTime[0];
    const mins = actualTime[1];
    const ss = actualTime[2];
    const ms = actualTime[3];

    return (<div>hour: {hour}
                mins:{mins}
                secs:{ss}
                milisecs:{ms}
                </div>)

}
